import React, { useEffect } from "react";
import styles from "./Men.module.css";
const Men = (props) => {
  useEffect(() => {
    props.setNavIndex(0);
  }, []);
  useEffect(() => {
    props.setUserColor("white");
  });

  return (
    <div className={styles.men}>
      <div className="container">
        <h2>MEN</h2>
        <ul className="tab_menu">
          <li>TOP</li>
          <li>OUTER</li>
          <li>PANTS</li>
        </ul>
      </div>
    </div>
  );
};
export default Men;
